INSERT INTO `backup` VALUES (1,'HPLaptop','Computers','20000','HP Laptop is came up with new features.','this HP Laptop is of red color, 500 GB Harddisk , 2gb RAM, i7 Processor, 4 hours of battery backup, buit in linux operating system,one year free service','27/09/2016   16:07:26'),(2,'Windows_OS','OperatingSystem','1500','the Windows OS is a operating system which used to interact with the hardware . which acts as an mediator between user and the hardware','Windows OS software , one time use , security softwares integrated with new updates.','27/09/2016   16:08:40'),(3,'macOS','OperatingSystem','2500','macOS is the current series of Unix-based graphical interface operatong systems developed and marketed by Apple Inc.','this mac os supports intel Macs (64-bit).it requires 2 GB RAM . buit-in Fireware and either a New World ROM or Intel Processor','27/09/2016   16:16:53'),(4,'Linux_OS','OperatingSystem','3000','A Linux-based system is a modular Unix-like operating systems, deriving much of its basic design from principles established in Unix during the 1970s and 1980s.','this Linus OS is open-source, Monolithic kernel. Linux was originally developed as a free operating system for personal computers based on the Intel x86 architecture.','27/09/2016   16:23:43'),(5,'Dell_System','Computers','25000','dell was an American Privately owned multinational computer technology company','BLACK Color Dell System, 15.6 inches screen size, LED display , 4 GB RAM Size,  500 GB Hard Drive ,Blue tooth, DOS OS','27/09/2016   16:33:06'),(6,'Yamaha','Bikes','50000','Yamaha Motor is a legendary company of Japan that manufactures high class motorcycles . ','Forged Pistons , Diamond Frame Chassis , Offset Cylinder , two wheeler , MotoGp electronics ','27/09/2016   16:39:31'),(7,'KTM_RC','Bikes','49000','the KTM RC is an entry-level bike with stylish looks and power-packed performance. ',' KTM RC has 6 gears , seat Height 820 mm , 10 litres og fuel tank capacity , top Speed 125 kmph','27/09/2016   16:44:38'),(8,'Micromax','Mobiles','7200','micromax is the 10th largest handset supplier globally . micromax is currently the 2nd largest smartphone company in India .','Micromax has dual sim , 5.5 inches , 32 GB , 3GN Ram internal , 8 mp camera , Android OS , vibration , MP3 sound , fingerprint , SMS in threaded view , HTML5 browser','27/09/2016   16:51:28'),(9,'Nokia','Mobiles','2700','The Nokia company has had various industries in its 151- year history , originally founded as a pulp mill','The Nokia 1100 is a basic GSM mobiles phone produced by Nokia. Nokia mobiles designed in california. Nokia has dual sim ,2 inches , 2 MB , 512 MB Ram internal , no camera , Android OS , vibration , MP3 sound ,  , SMS in threaded view  ','27/09/2016   16:57:45'),(10,'Samsung','Mobiles','5000','the samsung company is among the biggest players in the smartphone market in the world .  It has recently developed smartphones running Tizen OS , as an alternative tot its Android based smartphones .','Samsung has dual sim , 6.5 inches , 8 GB , 2GB Ram internal , 15 mp camera , Android OS , vibration ,  fingerprint , SMS in threaded view , HTML5 browser','27/09/2016   17:02:03'),(11,'Mixer','Home Appliances','750','it is a machine which mixes all..','white color Mixer ,one year free service','29/09/2016   15:12:59'),(12,'Preethi_Wet_Grinder','Home Appliances','4500','It is used to grind rice for dosa and idle','The Preethi \' Smart Grind Wet Grinder\' has an UL recognized Motor. Besides a one year guarantee is provided for Mixer Grinder purchased in India.','03/10/2016   17:43:57'),(13,'SamsungJ7','Products','18900','It is having nice GUI','\r\nAnswering a  call is too silly an excuse for you to risk your safety while riding. For a smart device that doubles up as a good riding companion, we bring to you the Samsung Galaxy J7 6. Activate the S bike mode and a pre-recorded message informs the caller that youâ??re riding. If itâ??s really important, the Motion Lock feature ensures that youâ??re parked safely before taking a call.','03/10/2016   18:30:52');


